const cards = [
  { src: '/public/assest/basketball.png' },
  { src: '/public/assest/closed_book.png' },
  { src: '/public/assest/comet.png' },
  { src: '/public/assest/cookie.png' },
  { src: '/public/assest/cover.png' },
  { src: '/public/assest/dizzy_face.png' },
  { src: '/public/assest/gear.png' },
  { src: '/public/assest/grapes.png' },
  { src: '/public/assest/tent.png' },
  { src: '/public/assest/tv.png' },
];

function App() {
  const shuffleCards = () => {
    const shuffled = [...cards, ...cards].sort(() => Math.random() - 0.5).map((card) => ({ ...card, id: Math.random() }));
  };

  shuffleCards();
  return <div className=""></div>;
}

export default App;
